import styled from 'styled-components'

const Container = styled.div`
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  //background: #d8c3c3;
  background: gray;
  ;

body,
#root {
  height: 100%;
  background-color: #f4f4f4
  background-color: #f4f4f4
}
`

const Body = styled.div`
  width: 100%;  
  border-collapse: separate;
  td {
    padding: 8px;
    vertical-align: middle;
    &:first-child {
      padding-left: 20px;
      text-transform: uppercase;
    }
  }
`
export {
  Container,
  Body
}
